import React, { Component } from "react";
import Car from '../../immagini/CAR.png';
import '../../App.css';
import AccessTimeIcon from '@material-ui/icons/AccessTime';
import { green } from '@material-ui/core/colors';
import MonetizationOnIcon from '@material-ui/icons/MonetizationOn';
import MapIcon from '@material-ui/icons/Map';
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser, setCurrentUser } from "../../actions/authAutentications";
import car from '../../immagini/CAR.png';
import { Container, Row, Col } from 'react-bootstrap';

class HomeCliente extends Component {

  constructor(props) {
    super(props);
  }


   onLogoutClick = e => {
      e.preventDefault();
      this.props.logoutUser();
   };
   

   render(){ 
    const { user } = this.props.auth;

    //Redirect
    if(user.ruolo==='Admin')
    this.props.history.push("/Dashboard");
      return( 
         <div className='HomeCliente'> 
            <Container>
  <Row>
    <Col sm={8}>sm=8</Col>
    <Col sm={4}><img src={car} alt="fiat-500" width="80%"/></Col>
  </Row>
  <Row>
    <Col sm>sm=true</Col>
    <Col sm>sm=true</Col>
    <Col sm>sm=true</Col>
  </Row>
</Container>  
         </div>
      ); 
   } 
}

HomeCliente.propTypes = {
    logoutUser: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired
  };
  
  const mapStateToProps = state => ({
    auth: state.auth
  });
  
  export default connect(
    mapStateToProps,
    { logoutUser }
  )(HomeCliente);
